def recommendation_validation(home_recommendation):
    if home_recommendation is None:
        return []  # Return an empty list if home_recommendation is None

    data = json.loads(home_recommendation)
    data1 = []
    if data is not None:
        for i in range(len(data)):
            if data[i]['Score'] > 2:
                data1.append(data[i])

    return data1

